import React from 'react';
import { Link } from 'react-router-dom';

const Navigation = () => (
  <div style = {styles.navBarStyle}>
    <ul>
      <li style={styles.listStyle}>
        <Link to='/'>Home</Link>
      </li>
      <li style={styles.listStyle}>
        <Link to='/signin'>Sign In</Link>
      </li>
      <li style={styles.listStyle}>
        <Link to='/signup'>Sign Up</Link>
      </li>
    </ul>
  </div>
);

const styles = {
    navBarStyle: {
        backgroundColor: 'red',
        height: 50
    },
    listStyle: {
        display: 'inline',
        padding: 20
    },
    listContainer: {
    }
}

export default Navigation;
